  return (
    <Box h="full" bg={Colors.gray}>
        <Pressable bg={Colors.white} alignItems="center" p={2} flexDirection="row">
            <Text fontSize={16} alignSelf="center">L·ªçc tin</Text>
            <FontAwesome name="sort-down" size={24} color="black" style={{paddingBottom: 10}}/>
        </Pressable>
        <ScrollView showsVerticalScrollIndicator={false}>
            <View mt={5}>
                <Text>a</Text>
            </View>
        </ScrollView>
    </Box>
  );
}

